import React from 'react';
import loading from './15.gif';

export default () => {
   return (
      <div className='loading flex--center'>
         <img
            src={loading}
            alt='Loading...'
            style={{ width: '100px', margin: '5px auto', display: 'block' }}
         />
         <h2 className='loading__text'>Loading...</h2>
      </div>
   );
};
